package com.hit.userms.model;import jakarta.persistence.*;import lombok.AllArgsConstructor;import lombok.Data;import lombok.NoArgsConstructor;import java.time.LocalDateTime;@Entity@NoArgsConstructor@AllArgsConstructor@Datapublic class RefreshToken {    @Id    @GeneratedValue(strategy = GenerationType.AUTO)    private Integer refreshTokenId;    private String rToken;    private LocalDateTime expiryTime;    @OneToOne    private UserEO userEO;}